import React, {useState } from 'react'
import { Link, useHistory } from 'react-router-dom'
import {Button, Divider, Dropdown, Menu} from 'semantic-ui-react'
import About from './pages/About'
import Help from './pages/Help'
import Home from './pages/Home'
import FileUp from './screen/FileUp'
import fileUp from './screen/FileUp'
import HouseDetails from './screen/HouseDetails'
import HousesInTheSameDistrict from './screen/HousesInTheSameDistrict'
import Login from './screen/Login'
import Register from './screen/Register'
import RegisterHouses from './screen/RegisterHouses'
import SwiperSlider from './screen/SwiperSlider'
import TenantScreen from './screen/TenantScreen'

const NavBar = (props) => {
  /* this is a handler for a navbar link item */
  const history = useHistory()
   const [activeItem,setActiveItem] = useState({
     name:'home'
   })

   const handleItemClick =(e,{name})=>{
     setActiveItem(name)
   }

    return (
        <div >
            <Menu 
            fixed='top'
            size='large'
            color='teal' 
            pointing 
            borderless
            style={{height:'70px'}}
           >

            <Menu.Item
              active={activeItem ==='home'}
              onClick={handleItemClick}
              as={Link}
              to={'/'}
            >
              KirayBet.com
            </Menu.Item>
            <Menu.Item
              color='red'
              active={activeItem === 'tenantscreen'}
              onClick={handleItemClick}
              as={Link}
              to={'/tenantscreen'}
            >
              Tenant Screen
            </Menu.Item>
            <Menu.Item

              active={activeItem === 'landlordscreen'}
              onClick={handleItemClick}
              as={Link}
              to={'/landordscreen'}
            >
            LandLord Screen
            </Menu.Item>
            <Menu.Item
              active={activeItem === 'listpropterty'}
              onClick={handleItemClick}
              as={Link}
              to={'/listpropterty'}
            >
            List Property
            </Menu.Item>
            <Menu.Item

              active={activeItem === 'managelisting'}
              onClick={handleItemClick}
              as={Link}
              to={'/managelisting'}
            >
            Manage Listing
            </Menu.Item>
            <Menu.Menu position='right'>
            <Menu.Item >
            <Dropdown
              text='LogIn'
              floating
              labeled
              button
              icon={null}
              style={{ marginRight: '0.5em' }}
            >
                  <Dropdown.Menu >
                    <Dropdown.Item 
                    onClick={history.push('/login')}
                    as={Link}
                    to={'/login'}
                    >LandLords Login</Dropdown.Item>
                    <Dropdown.Divider />
                    <Dropdown.Item
                    onClick={history.push('/login')}
                    as={Link}
                    to={'/login'}
                    >Tenants Login</Dropdown.Item>
                  </Dropdown.Menu>
              </Dropdown>
              <span>
                <pre>
                  |
                </pre>
              </span>
              <Dropdown
                text='SignUp'
                direction='left'
                floating
                labeled
                button
                icon={null}
                style={{ marginLeft: '0.5em' }}
              >
                  <Dropdown.Menu >
                  <Dropdown.Item
                  onClick={history.push('/register')}
                  as={Link}
                  to={'/register'}
                  >LandLords SignUp</Dropdown.Item>
                    <Dropdown.Divider />
                    <Dropdown.Item
                    onClick={history.push('/register')}
                    as={Link}
                    to={'/register'}
                    >Tenants SignUp</Dropdown.Item>
                  </Dropdown.Menu>
              </Dropdown>


            </Menu.Item>
            <Menu.Item>
              profile
            </Menu.Item>
            </Menu.Menu>
           </Menu>
           <Router>
                <NavBar/>
                <Route exact path="/"><Home/></Route>
                <Route path="/about"><About/></Route>
                <Route path="/help"><Help/></Route>
                <Route path="/login"><Login/></Route>
                <Route path="/listpropterty"><FileUp/></Route>
                <Route path="/tenantscreen"><SwiperSlider/></Route>
                <Route path="/houseDetails/:productId"><HouseDetails/></Route>
                <Route path="/houseDistrict/:district"><HousesInTheSameDistrict/></Route>




            </Router>

        </div>
    )
}

export default NavBar
